function Help(section) {
	
		$("#dleuserpopup").remove();
		$("body").append("<div id='dleuserpopup' title='Help' style='display:none'></div>");

		if(section == "social") {

			var w = 800;

		} else {

			var w = 570;
		}
	
		$('#dleuserpopup').dialog({
			autoOpen: true,
			width: w,
			height: 550,
			resizable: false,
			buttons: {
				"OK": function() { 
					$(this).dialog("close");
					$("#dleuserpopup").remove();							
				}
			},
			open: function(event, ui) { 
				$("#dleuserpopup").html("<iframe width='100%' height='440' src='?mod=help&section=" + section + "' frameborder='0' marginwidth='0' marginheight='0' allowtransparency='true'></iframe>");
			},
			beforeClose: function(event, ui) { 
				$("#dleuserpopup").html("");
			}
		});


		return false;


}
function ShowOrHide(d1, d2) {
	if (d2) { 

		DoDiv(d1); 
		DoDiv(d2); 

	} else {

		var item = $("#" + d1);
		if (item.is(":hidden")) { 
			item.show('blind',{},1000);
		} else {
			item.hide('blind',{},1000);
		}

	}
}
function DoDiv(id) {

	if ( $("#" + id).is(":hidden") ) {

		$("#" + id).show(1);

	} else {

		$("#" + id).hide(1);
	}
}

var boxedpanel = 0;
function toggleleftpanel() {

	if ( !boxedpanel ) {
		$('.primary-sidebar, .sidebar-background').hide();
		$('.main-content').css( "margin", "0" );
		$('#maincontainer').addClass( "boxed" );
		$('.boxedhidden').show();
		boxedpanel = 1;

	} else {
		$('.primary-sidebar, .sidebar-background').show();
		$('#maincontainer').removeClass( "boxed" );
		$('.main-content').css( "margin-left", "251px" );
		$('.boxedhidden').hide();
		boxedpanel = 0;
	}

	if(typeof(Storage)!=="undefined")
	{
		localStorage.setItem("boxedpanel", boxedpanel);
	}

}

function ShowLoading( message )
{

	if ( message )
	{
		$("#loading-layer").html(message);
	}
		
	var setX = ( $(window).width()  - $("#loading-layer").width()  ) / 2;
	var setY = ( $(window).height() - $("#loading-layer").height() ) / 2;
			
	$("#loading-layer").css( {
		left : setX + "px",
		top : setY + "px",
		position : 'fixed',
		zIndex : '99'
	});
		
	$("#loading-layer").fadeTo('slow', 1.0);

};

function HideLoading( message )
{
	$("#loading-layer").fadeOut('slow');
};

function DLEalert(message, title){

	$("#dlepopup").remove();

	$("body").append("<div id='dlepopup' class='dle-alert' title='" + title + "' style='display:none'>"+ message +"</div>");

	$('#dlepopup').dialog({
		autoOpen: true,
		width: 500,
		minHeight: 160,
		resizable: false,
		buttons: {
			"Ok": function() { 
				$(this).dialog("close");
				$("#dlepopup").remove();							
			}
		}
	});
};

function DLEconfirm(message, title, callback){

	var b = {};

	b[dle_act_lang[1]] = function() { 
					$(this).dialog("close");
					$("#dlepopup").remove();						
			    };

	b[dle_act_lang[0]] = function() { 
					$(this).dialog("close");
					$("#dlepopup").remove();
					if( callback ) callback();					
				};

	$("#dlepopup").remove();

	$("body").append("<div id='dlepopup' class='dle-confirm' title='" + title + "' style='display:none'>"+ message +"</div>");

	$('#dlepopup').dialog({
		autoOpen: true,
		width: 500,
		minHeight: 160,
		resizable: false,
		buttons: b
	});
};

function DLEprompt(message, d, title, callback, allowempty){

	var b = {};

	b[dle_act_lang[3]] = function() { 
					$(this).dialog("close");						
			    };

	b[dle_act_lang[2]] = function() { 
					if ( !allowempty && $("#dle-promt-text").val().length < 1) {
						 $("#dle-promt-text").addClass('ui-state-error');
					} else {
						var response = $("#dle-promt-text").val()
						$(this).dialog("close");
						$("#dlepopup").remove();
						if( callback ) callback( response );	
					}				
				};

	$("#dlepopup").remove();

	$("body").append("<div id='dlepopup' class='dle-promt' title='" + title + "' style='display:none'>"+ message +"<br /><br /><input type='text' name='dle-promt-text' id='dle-promt-text' class='ui-widget-content ui-corner-all' style='width:97%;' value=\"" + d + "\"/></div>");

	$('#dlepopup').dialog({
		autoOpen: true,
		width: 500,
		resizable: false,
		buttons: b
	});

	if (d.length > 0) {
		$("#dle-promt-text").select().focus();
	} else {
		$("#dle-promt-text").focus();
	}
};

